import React, { useRef } from "react";
import { useForm } from "react-hook-form";
import { Link, useHistory } from "react-router-dom";

import ApiEndpoints from "../../../api/apiEndpoints";
import AppPaths from "../../../lib/appPaths";
import "../authStyle.css";

const SignupScreen = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
    watch,
  } = useForm();
  const password = useRef({});
  password.current = watch("password");
  const image = watch("image");
  const history = useHistory(); // useHistory hook for navigation

  const onSubmit = async (signupData) => {
    try {
      const formData = new FormData();
      formData.append("image", signupData.image[0]);
      delete signupData["image"];
      Object.keys(signupData).forEach((key) => {
        formData.append(key, signupData[key]);
      });

      const response = await axios.post(ApiEndpoints.SIGN_UP_URL, formData, {
        headers: {
          'Content-Type': 'multipart/form-data', // Set content type for file uploads
        },
      });

      if (response.status === 201) { // Assuming 201 is the success status
        history.push({
          pathname: AppPaths.LOGIN,
          state: { redirectFrom: AppPaths.SIGN_UP },
        });
      }
    } catch (error) {
      console.error('There was an error signing up!', error);
    }
  };

  return (
    <div id="authFormContainer">
      <div id="authForm">
        <h2 id="authTitle">Sign Up</h2>
        <form onSubmit={handleSubmit(onSubmit)}>
          <div className="authFieldContainer">
            <input
              className="authField"
              type="text"
              placeholder="First Name"
              {...register("first_name", { required: true })}
            />
            {errors.first_name && (
              <p className="requiredFieldError">This field is required</p>
            )}
          </div>
          <div className="authFieldContainer">
            <input
              className="authField"
              type="text"
              placeholder="Last Name"
              {...register("last_name", { required: true })}
            />
            {errors.last_name && (
              <p className="requiredFieldError">This field is required</p>
            )}
          </div>
          <div className="authFieldContainer">
            <input
              className="authField"
              type="email"
              placeholder="Email"
              {...register("email", { required: true })}
            />
            {errors.email && (
              <p className="requiredFieldError">This field is required</p>
            )}
          </div>
          <div className="custom-file">
            <input
              type="file"
              name="image"
              id="validatedCustomFile"
              {...register("image", {
                required: true,
              })}
            />
            <label className="custom-file-label" htmlFor="validatedCustomFile">
              {image ? image[0]?.name : "Choose Image..."}
            </label>
            {errors.image && (
              <p className="requiredFieldError mt-2">This field is required</p>
            )}
          </div>
          <div className="authFieldContainer">
            <input
              className="authField"
              type="password"
              placeholder="Password"
              {...register("password", { required: true })}
            />
            {errors.password && (
              <p className="requiredFieldError">This field is required</p>
            )}
          </div>
          <div className="authFieldContainer">
            <input
              className="authField"
              type="password"
              name="passwordTwo"
              placeholder="Confirm Password"
              {...register("passwordTwo", {
                required: "This field is required",
                validate: (value) =>
                  value === password.current || "The passwords don't match",
              })}
            />
            {errors.passwordTwo && (
              <p className="requiredFieldError">
                {errors.passwordTwo?.message}
              </p>
            )}
          </div>
          <br />
          <button className="btn btn-outline-warning btn-block" type="submit">
            Sign Up
          </button>
        </form>
        <p id="authFormFooter">
          Already have an account? <Link to="/login">Click here</Link> to login.
        </p>
      </div>
    </div>
  );
};

export default SignupScreen;
